import React from "react";
import { Form, Card, Button, Input, Space } from "antd";
import "./index.css";

const layout = {
  labelCol: {
    span: 6,
  },
  wrapperCol: {
    span: 16,
  },
};
const tailLayout = {
  wrapperCol: {
    offset: 8,
    span: 16,
  },
};

export default class Login extends React.Component {
  constructor(props){

  }
  // 提交表单且数据验证成功后回调事件
  onFinish = (values) => {
    console.log("Success:", values);
  };
  // 提交表单且数据验证失败后回调事件
  onFinishFailed = (errorInfo) => {
    console.log("Failed:", errorInfo);
  };
  render() {
    return (
      <Card
        title="登陆页面"
        className="login-form"
      >
        <Form
          {...layout}
          name="basic"
          initialValues={{
            remember: true,
          }}
          onFinish={onFinish}
          onFinishFailed={onFinishFailed}
        >
          <Form.Item
            label="账号"
            name="userId"
            rules={[
              {
                required: true,
                message: "请输入账号",
              },
            ]}
          >
            <Input />
          </Form.Item>

          <Form.Item
            label="密码"
            name="password"
            rules={[
              {
                required: true,
                message: "请输入密码",
              },
            ]}
          >
            <Input.Password />
          </Form.Item>
          <Form.Item
            label="确认密码"
            name="checkPassword"
            rules={[
              {
                required: true,
                message: "请确认密码",
              },
            ]}
          >
            <Input.Password />
          </Form.Item>

          <Form.Item {...tailLayout}>
            <Space size="middle">
              <Button type="primary" htmlType="submit" onClick={this.login}>
                登陆
              </Button>
              <Button type="primary" htmlType="submit" onClick={this.signIn}>
                注册
              </Button>
            </Space>
          </Form.Item>
        </Form>
      </Card>
    );
  }
};
